/** Get learnset for a species. */
export function getLearnset(speciesId: number): LearnsetEntry[] {
  return LEARNSETS[speciesId] ?? [];
}

/** Get moves a Pokemon should know at a given level (last 4 learned moves at or below level). */
export function getMovesAtLevel(speciesId: number, level: number): number[] {
  const learnset = getLearnset(speciesId);
  const learned = learnset.filter(e => e.level <= level).map(e => e.moveId);
  // Return last 4 unique moves (most recently learned)
  const unique = [...new Set(learned.reverse())].reverse();
  return unique.slice(-4);
}
